import Header from "./Header"
import Button from "./Button"
import { Typography, Appbar, Car, CardAction, CardContent, CardMedia, CssBaseLine, Grid, Toolbar, Container, Menu, MenuItem } from '@material-ui/core';
import Link from '@material-ui/core/Link';
import PrimarySearchAppBar from '@material-ui/core/AppBar';
import MenuList from '@material-ui/core/MenuList';
import Box from '@material-ui/core/Box';
import sideBar from './SideBar';



export default class HomePage extends Component {
    static displayName = HomePage.name;

    constructor(props) {
        super(props);
        this.state = { 
            storeidtoshowhistory: undefined,
            useremailtoshowhistory: undefined,
            useremailtoremove: undefined,
            storeidtoremove: undefined,
            
        };
        this.adminApi = new AdminApi();

    }









HomePage = () => {
    return (
        <>
            <PrimarySearchAppBar position="relative" color="white">
                <Toolbar>
                    <Typography variant="h6" color="inherit" noWrap>
                        Hello Guest,
                    </Typography>
                    <Link
                        component="button"
                        variant="body2"
                        position="center"
                        onClick={() => {
                            console.info("I'm Login button, add link.");
                        }}
                    >
                        Login
                    </Link>
                    <Link
                        component="button"
                        variant="body2"
                        position="relative"
                        align="center"
                        onClick={() => {
                            console.info("I'm Register button, add link.");
                        }}
                    >
                        \ Register
                    </Link>
                </Toolbar>
            </PrimarySearchAppBar>
            <header>
                <Header />
                {/*  <Button color='blue' text='login'/> */}
            </header>
            <Box sx={2} >
                <MenuList>
                    <MenuItem onClick={() => {
                        console.info("I'm Open Store, add link.");
                    }}>Open Store</MenuItem>
                    <MenuItem onClick={() => {
                        console.info("I'm Send Complaint, add link.");
                    }}>Send Complaint</MenuItem>
                    <MenuItem onClick={() => {
                        console.info("I'm Admin Options, add link.");
                    }}>Admin Options</MenuItem>
                </MenuList>
            </Box>         
        </>
    )
}
}
